import React from "react";
import styled from "styled-components";

import Goals from "./Goals";

////////////////////// MAIN //////////////////////
const MainContainer = styled.div`
    height: 50%;
`;

const Main = () => {
    return (
        <MainContainer>
            <Goals />
            Oh, hey Jonny, what's up?
        </MainContainer>
    );
};

export default Main;
